import ReactDOM from 'react-dom';
import './index.css'
import {BrowserRouter} from "react-router-dom";
import Body from "./components/Body";
import store from "./redux/store";
import View from "./components/View";

ReactDOM.render(
    <BrowserRouter>
        {/*<Body/>*/}
        <View/>
    </BrowserRouter>,
    document.getElementById('root')
);
store.subscribe(() => {
    ReactDOM.render(
        <BrowserRouter>
            <Body/>
        </BrowserRouter>,
        document.getElementById('root')
    );
});
